import ListTask from "./ListTask";
const Form = () => {

    const [taskInput , setTaskInput] = useState("")


    console.log(taskInput)

    return (
        <>
            <div className=" d-flex justify-content-center">
                <div>
                    <input  type="text" className="form-control" onChange={()=>(e)=>setTaskInput(e.target.value)} />
                </div>
                <div>
                    <button className="btn btn-primary  " style={{ "marginLeft": "5px" }}>Add new task</button>
                </div>
            </div>
            <ListTask/>
        </>
    );
};

export default Form;
